import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <nav className="navbar">
            <div className="logo">
                <Link id='logo' to="/">
                    DODO RESTAURANT
                </Link>
            </div>

            <div className="links">
                <Link to="/">Home</Link>
                <Link to="/menu">Menu</Link>
                <Link to="/reviewspage">Reviews</Link>
                <Link to="/orderonlinepage" style={{
                    color: "white",
                    backgroundColor: 'rgb(0, 0, 84)',
                    borderRadius: '8px'
                }}>Order Online</Link>
                <Link to="/book" style={{
                    color: "white",
                    backgroundColor: 'rgb(0, 0, 84)',
                    borderRadius: '8px'
                }}>Book Now</Link>
            </div>
        </nav>
    );
}

export default Navbar;
